    componentDidMount() {
        if (EventStore.access_token === '') {
            let parsed = queryString.parse(window.location.search);
            let accessToken = parsed.access_token
            EventStore.accessToken = accessToken
            console.log(EventStore.accessToken)
        } else {
            console.log(EventStore.accessToken)
            let config = {
                method: 'get',
                url: 'https://www.eventbriteapi.com/v3/categories/103/',
                headers: {
                    'Authorization': `Bearer ${EventStore}`
                }
            };

            axios(config)
                .then(function (response) {
                    console.log(JSON.stringify(response.data));
                })
                .catch(function (error) {
                    // console.log(error);
                });
        }
    }

    render() {
        return (
            <div >
                <h2>Events</h2>
                <button onClick={() => window.location = 'http://localhost:8888/getEvents'}>Check for Events</button>
            </div >
        );
    }
}

export default Events;
